

export function numSub(s: string): number {
    let count = 0;
    let sequence = 0;
    for (let i = 0; i < s.length; i++) {
        if(s[i] === '1') {
            sequence++;
            if(i === s.length - 1) {
                count += (sequence + 1) * Math.floor(sequence / 2);
            }
        } else if(sequence > 0) {
            count += (sequence + 1) * Math.floor(sequence / 2);
            sequence = 0;
        }

    }
    
    return count;
};

